DROP TABLE IF EXISTS `recruit_position`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `recruit_position` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '职务名称',
  `requirement` text NOT NULL COMMENT '要求',
  `work_city` varchar(50) NOT NULL COMMENT '工作城市',
  `phonenumber` varchar(255) NOT NULL COMMENT '联系电话',
  `release_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发布时间',
  `valid_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '截止日期',
  `quantity` int NOT NULL DEFAULT '1' COMMENT '招聘人数',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态（0是未结束1是结束）',
  `audit_state` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态',
  `salary_up` int NOT NULL COMMENT '最低薪资',
  `salary_down` int NOT NULL COMMENT '最高薪资',
  `hot` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否热门',
  `company_id` bigint NOT NULL COMMENT '公司ID',
  `category_id` bigint DEFAULT '17' COMMENT '分类ID',
  PRIMARY KEY (`id`),
  KEY `company_id` (`company_id`),
  KEY `category_id` (`category_id`),
  CONSTRAINT `recruit_position_ibfk_1` FOREIGN KEY (`company_id`) REFERENCES `recruit_company_info` (`id`),
  CONSTRAINT `recruit_position_ibfk_2` FOREIGN KEY (`category_id`) REFERENCES `recruit_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1028 DEFAULT CHARSET=utf8 COMMENT='招聘岗位表';
